                    setPassword_value(password_value);


                    // let users = await getfetch(`https://localhost:3678/customers`);//bring array of customers that hav this specific name/${user_name_value}
                    let flag = await fetch(`http://localhost:3678/customer/getcustomers`, {
                        method: 'POST',
                        headers: {
                            'Accept': 'application/json',
                            'Content-Type': 'application/json'
                        },
                        body: JSON.stringify({ username: user_name_value, password: password_value })
                    });
                    flag = await flag.json();
                    // let flag = false;
                    // if(users)
                    // {
                    //     users.forEach((element, i) => {
                    //     if ((users[i].costemerID) === password_value) {
                    //         flag = true;
                    //         myuser=users[i];
                    //     }
                    //  });
                    // }

                    if (!flag) {
                        // alert("the password or username do nnnnot exist");

                        fetch(`http://localhost:3678/customer`, {
                            method: 'POST',
                            headers: {
                                'Accept': 'application/json',
                                'Content-Type': 'application/json'
                            },
                            body: JSON.stringify({
                                username: user_name_value,
                                password: password_value
                            })
                        });

                        navigate(`/Client`);
                        // navigate(`/manager`);
                        sessionStorage.setItem("currentuser", JSON.stringify({ password: password_value, user_name: user_name_value, cart: [], OrderID: "0" }));
                        let today = new Date();
                        let date = today.getFullYear() + '-' + (today.getMonth() + 1) + '-' + today.getDate();
                        let res = await fetch(`http://localhost:3678/orders/add`, {
                            method: 'POST',
                            headers: {
                                'Accept': 'application/json',
                                'Content-Type': 'application/json'
                            },
                            body: JSON.stringify({ customerid: JSON.parse(sessionStorage.getItem("currentuser")).password, orderprice: 0, date: date, status: 0 })
                        });
                        res = await res.json();
                        sessionStorage.setItem("currentuser", JSON.stringify({ password: password_value, user_name: user_name_value, cart: [], OrderID: res }));

                        //    cur=   sessionStorage.getItem("currentuser");
