                        //     props.define_user(users);
                        //     navigate("/user");
                        // }
                    }
                }
            }

        } catch (error) {
            alert(error);
        }
        savePasswordValue("");
        saveUsernameValue("");
    }
    let cur = JSON.parse(sessionStorage.getItem("currentuser"));
    // if (cur) {
